// code for otp timer
function validateInput(input, index) {
    const inputs = document.querySelectorAll('.otp-input input');
    input.value = input.value.replace(/\D/g, ''); // Allow only digits
    if (input.value && index < inputs.length - 1) {
        inputs[index + 1].focus();
    }
}

function startTimer(durationInSeconds) {
    let timer = durationInSeconds;
    const display = document.getElementById('timer');

    const interval = setInterval(() => {
        let minutes = Math.floor(timer / 60);
        let seconds = timer % 60;

        minutes = minutes < 10 ? "0" + minutes : minutes;
        seconds = seconds < 10 ? "0" + seconds : seconds;

        display.textContent = `Time remaining: ${minutes}:${seconds}`;

        if (timer <= 0) {
            clearInterval(interval);
            display.textContent = "OTP expired";
        }
        timer--;
    }, 1000);
}

document.addEventListener("DOMContentLoaded", () => {
    startTimer(90); // 90 seconds countdown
});





document.addEventListener("DOMContentLoaded", function () {
    const textContainer = document.querySelector(".text-container");

    const observer = new IntersectionObserver((entries) => {
        entries.forEach(entry => {
            if (entry.isIntersecting) {
                textContainer.classList.add("active"); // Add animation class
            } else {
                textContainer.classList.remove("active"); // Remove when out of view
            }
        });
    }, { threshold: 0.5 }); // Triggers when 50% of the element is visible

    observer.observe(textContainer);
});
