// code for products and services
document.addEventListener("DOMContentLoaded", function () {
    const cards = document.querySelectorAll(".service");

    const observer = new IntersectionObserver(
        (entries) => {
            entries.forEach((entry) => {
                if (entry.isIntersecting) {
                    entry.target.classList.add("show");
                } else {
                    entry.target.classList.remove("show"); // Remove class when out of view
                }
            });
        },
        {
            threshold: 0.1 // Trigger when 20% of the card is visible
        }
    );

    cards.forEach((service) => {
        observer.observe(service);
    });
});

// code for the responsiveness of nav bar
document.addEventListener("DOMContentLoaded", () => {
    const menuToggle = document.getElementById("mobile-menu");
    const navLinks = document.querySelector(".nav-links");

    menuToggle.addEventListener("click", () => {
        navLinks.classList.toggle("active");
    });
});

// code for sms popup
// Get popup elements
const popup = document.getElementById("smsPopup");
const openPopup = document.getElementById("openPopup");
const closePopup = document.querySelector(".close");

// Open popup when button is clicked
openPopup.addEventListener("click", () => {
    popup.style.display = "block";
});

// Close popup when clicking the "X"
closePopup.addEventListener("click", () => {
    popup.style.display = "none";
});

// Close popup when clicking outside of it
window.addEventListener("click", (e) => {
    if (e.target === popup) {
        popup.style.display = "none";
    }
});




       






